import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="home">
      {/* Image Background */}
      <div className="background-image"></div>
      
      {/* Glassmorphism Effect for Content */}
      <div className="content">
        <h1>Welcome to Health&me</h1>
        <p>Your personal guide to food logging, exercise tracking, and more!</p>
      </div>
    </div>
  );
}

export default Home;
